window.bookSummaryJSON = "<p><b>Broke ex-waitresses aren’t supposed to have archenemies.</b><br> <b>Seriously, that kind of crap is way above our pay grade.</b><br> </p> <p>We certainly aren’t supposed to have multiple supernatural beings competing for the title of “scariest nemesis.” Yet, that’s where I find myself, now that the last vampire on Earth is no longer the last vampire on Earth.<br> </p> <p>Ransley Thorpe turned his closest friend in a last-ditch effort to save his life. Now all three of us have targets painted on our backs, and the powerful demon who might be able to protect us is the last person in the three realms we should trust.<br> </p> <p>To survive, we’ll have to rekindle old alliances and rely on friends who have only the barest conception of the danger they’re about to face. One thing is crystal clear - even if we succeed in holding our enemies at bay, my life is about to change in ways I could never have foreseen.<br> </p> <p><b>As the only demon/fae/human hybrid in existence, I thought I had problems before.</b><br> <b>Silly me. It turns out, I didn’t know when I was well off.</b></p> <p>The Last Vampire is a steamy urban fantasy romance series from <i>USA Today</i> bestseller R. A. Steffan and Jaelynn Woolf, co-authors of the Circle of Blood saga. <br> </p> <p>Order book five today, and enter a world shared by humans, fae, demons, and one very reluctant vampire. It’s a place where the supernatural threatens the mundane, nothing is as it seems, and love will either be the world’s downfall - or its salvation.</p>"; 
